import './App.css';
import { Component } from 'react';

class App extends Component {

  constructor(){
    super();
    this.state = {
      monsters: [
        {
          name: "Frankenstein",
          id: "123"
        },
        {
          name: "Dracula",
          id: "456"
        },
        {
          name: "Zombie",
          id: "789"
        }
      ]

    }
  }

  render(){
    return (
      <div className="App">
        {this.state.monsters.map(monster =>
          <h1 key={monster.id}> {monster.name} </h1>
        )}
      </div>
    );
  }
}

export default App;
